/** 
 * Create the data corresponding to a RTTI0 TypeDescriptor structure which contains a flexible-array as its last component ( char[0]  name ).  The string data associated with this flexible char array will be applied as a sized character array immediately following the structure whose size does not include the char array bytes.
 * @return false if the data type was not created because it already exists, true otherwise
 * @throws CodeUnitInsertionException
 * @throws CancelledException
 */
